import React from 'react';
import Landing from './Landing';
import SkillsList from './SkillsList';


const Greeting = ({isLoggedIn, skills, setSkills, session, setSession, refreshHandler }) => {

    if (isLoggedIn) {
        return <SkillsList 
        skills={skills} 
        setSkills={setSkills}
        session={session}
        setSession={setSession} 
        refreshHandler={refreshHandler}
      />
    }
    else {
        return <Landing />
    }
}


export default Greeting;
